import React, { Component } from 'react';
import './Menu.css';
class Menu extends Component {

  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return(
      <div>
        <ul>
          <li>Option 1</li>
          <li>Option 2</li>
        </ul>
      </div>
    );
  }

}

export default Menu;
